data

data = [
  ["Popularity", "df"],
  ["tanuja", 1245],
  ["shrre", 2362],
  ["ritesh", 1522],
  ["manas", 2950],
  ["palak", 1787],
];
 const options = {
  title: "Most Popular Candidate of all Regions",
};

const PieChart = () => {
  return (
    <Chart
      chartType="PieChart"
      data={data}
      options={options}
      width={"60%"}
      height={"400px"}
    />
  )
}
export default PieChart;
